import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import Campsite from "./Campsite/Campsite";
import House from "./House/House";

const Main = () => {
  return;
  <div>
    <ul>
      <li>
        <Link path="/start" />
      </li>
      <li>
        <Link path="/about" />
      </li>
    </ul>
    <Routes>
      <Route />
      <Route />
    </Routes>
  </div>;
};

export default Main;
